DESCRIPTION:
Sveiki, smarkiai išaugo tranzitinis eismas Lauksargio g., vairuotojai renkasi ją kaip alternatyvų maršrutą. Deja gatvė nėra pritaikyta tokiems automobilių srautams.  
Problemos:
-Gatvė vietomis yra per siaura prasilenkti;
-Gatve vietomis yra neapšviesta;
-Gatvėje neįrengti šaligatviai;
-Automobiliai iš kiemų išvažiuoja į gatvę;
-Ši gatvė yra prižiūrima minimaliai, žiemos metu, dėl reljefo, yra sunkiai įveikiama.
-Gatvėje parkuojami automobiliai. 
Tranzitinio srauto automobiliai dažnai skuba ir sukelia pavojų kitiems eismo dalyviams, taip pat ir pėstiesiems, nors gatvėje vietomis greitis ribojamas iki 20 km/h. 
Kvartale gyvena daug vaikų, jiems yra nesaugu eiti minėta gatve iki viešojo transporto stoteles.
Ar galima būtų išnagrinėti prašymą riboti tranzitinį eismą Lauksargio g., arba bent pagerinti eismo sąlygas visiems dalyviams, ypač pėstiesiems. Pavyzdžiui praplečiant greičio ribojimo zoną, įrengiant greičio mažinimo priemones, šaligatvius, apšvietimą, užtikrinant priežiūrą. Ačiū.

ANSWER:
 Laba diena, Pagal Kelių eismo taisykles automobiliams sustoti ir stovėti draudžiama ant vejos, šaligatvio, ten, kur pastatyta transporto priemonė trukdytų įvažiuoti (išvažiuoti) į (iš) stovėjimo vietą (-tos), aikštelę (-ės), garažą (-o) arba kitaip kliudytų transporto priemonių ar pėsčiųjų eismui (150.10 punktas). Taip pat jei pastatytos transporto priemonės nepalieka bent 3 metrų pločio laisvo pravažiavimo pažeidžia Kelių eismo taisykles (150.7. punktas).  Lietuvos Respublikos saugaus eismo automobilių keliais įstatymo 10 straipsnio 9 dalis nustato, kad eismo priežiūrą vykdo specializuoti policijos padaliniai ir įgalioti policijos pareigūnai. Užtikrindama eismo saugumą, policija:
1) prižiūri, kaip eismo dalyviai laikosi šio įstatymo nuostatų ir kituose teisės aktuose nustatytos eismo tvarkos;
2) reguliuoja eismą;
3) tiria Kelių eismo taisyklių pažeidimus, atlieka ikiteisminį tyrimą eismo įvykių bylose, įstatymų nustatytais atvejais surašo administracinių teisės pažeidimų protokolus, nagrinėja administracinių teisės pažeidimų bylas ir priima nutarimus šiose bylose, taiko kitas įstatymų numatytas priemones.
Lietuvos Respublikos administracinių teisės pažeidimų kodeksas numato, kad savivaldybių vykdomųjų institucijų ir jų tam įgalioti pareigūnai turi teisę surašyti administracinių teisės pažeidimų protokolus už sustojimą ar stovėjimą vietose, kuriose Kelių eismo taisyklės draudžia sustoti ar stovėti, taip pat už sustojimą ar stovėjimą nesilaikant kelio ženklų ir ženklinimo reikalavimų. Pažeidimų nustatymas ir kaltininkų patraukimas administracinėn atsakomybėn labai priklauso nuo operatyvaus pranešimo apie daromą teisės pažeidimą. Jei ateityje pastebėsite galimus pažeidimus, apie tai nedelsiant praneškite policijai telefonu 112 ar naudojantis policijos elektroninių paslaugų sistema <a href="https://www.epolicija.lt" target="_blank">https://www.epolicija.lt</a> arba Savivaldybės administracijos Viešosios tvarkos skyriui telefonu 219 7948 ar elektroniniu paštu <a href="mailto:viesoji.tvarka@vilnius.lt.">viesoji.tvarka@vilnius.lt.</a> Savivaldybės administracijos Viešosios tvarkos skyriaus pareigūnai, atvykę pagal pranešimą turėtų galimybę tinkamai surinkti įrodymus apie pažeidimą, nustatyti pažeidimą padariusius asmenis ir patraukti juos atsakomybėn. Atkreipiame Jūsų dėmesį į tai, kad viešosios tvarkos ir visuomenės saugumo užtikrinimas yra pagrindiniai policijos uždaviniai, todėl nenutrūkstamas policijos darbas organizuojamas visą parą, o Savivaldybė tik dalyvauja, bendradarbiauja užtikrindama viešąją tvarką, todėl neturi galimybės nuolat ir nedelsdami reaguoti į asmenų pranešimus apie galbūt padarytus teisės pažeidimus. Savivaldybės administracijos Viešosios tvarkos skyriaus pareigūnai dirba pirmadieniais–ketvirtadieniais nuo 6 iki 23 val., penktadieniais nuo 6 iki 24 val., šeštadieniais nuo 00 iki 6 val. ir nuo 8 iki 24 val., sekmadieniais nuo 00 iki 6 val. ir nuo 8 iki 22 val

